import React, { useState } from 'react';
import axios from 'axios';

function App() {
    const [e_sal_emp_code, sete_sal_emp_code] = useState('');
    const [employeeDetails, setEmployeeDetails] = useState(null);

    const getEmployeeDetails = async () => {
        try {
            const response = await axios.get(`http://localhost:3001/api/employee/${e_sal_emp_code}`);
            setEmployeeDetails(response.data);
            console.log(employeeDetails);
        } catch (error) {
            console.error(error);
            // Handle error
        }
    };

    return (
        <div>
            <input
                type="text"
                placeholder="Enter Employee Code"
                value={e_sal_emp_code}
                onChange={(e) => sete_sal_emp_code(e.target.value)}
            />
            <button onClick={getEmployeeDetails}>Get Details</button>

            {employeeDetails && (
                <div>
                    <h2>Salary Details</h2>
                    <p>Salary Month :{employeeDetails[0]}</p>
                    <p>Salary Year :{employeeDetails[1]}</p>
                    <p>Employee Code :{employeeDetails[2]}</p>
                    <p>Basic Salary :{employeeDetails[4]}</p>
                    <p>Dearness Allowances :{employeeDetails[0]}</p>
                    <p>House Rent Allowances :{employeeDetails[0]}</p>
                    <p>Gross Salary :{employeeDetails[0]}</p>
                    <p>Lic Deduction :{employeeDetails[0]}</p>
                    <p>Advance :{employeeDetails[0]}</p>
                    <p>Transport :{employeeDetails[0]}</p>
                    <p>Esi(Employee State Insurance) :{employeeDetails[0]}</p>
                    <p>Provident Fund :{employeeDetails[0]}</p>
                    <p>Employee Provident  :{employeeDetails[0]}</p>
                    <p>Net salary: {employeeDetails[18]}</p>
                    {/* <p>Department: {employeeDetails.DEPARTMENT}</p> */}
                    {/* Add more details as needed */}
                </div>
            )}
        </div>
    );
}

export default App;
